import "./ProfileInfoStyle.css"

export default function ProfileInfo(profile, person) {
    console.log(profile);
    return (
        <div className="user-profile">
            <div className="user-img">
                <div className="img-border"><img src={person.image}/></div>
            </div>
            <div className="user-info">
                <p className="name">Name: {person.name}</p>
                <p className="age">Age: {person.age}</p>
                <p className="location">Location: {person.location}</p>
            </div>
        </div>
    )

}
